import React from "react";
import { Link } from "react-router-dom";

export const routes = [
  {
    path: "/",
    exact: true,
    sidebar: null
  },
  {
    path: "/website",
    sidebar: (
      <ul>
        <li key="/websiteinfo">
          <Link to="/websiteinfo">Web Site Info</Link>
        </li>
        <li key="/credentials">
          <Link to="/credentials">Credentials</Link>
        </li>
        <li key="status">
          <Link to="/status">Status</Link>
        </li>
      </ul>
    )
  },
  {
    path: "/tasks",
    sidebar: (
      <ul>
        <li>
          <Link>Taks Link 2</Link>
        </li>
        <li>
          <Link to="/taskLink">Another Taks Link</Link>
        </li>
      </ul>
    )
  },
  {
    path: "/projects",
    sidebar: (
      <ul>
        <li>
          <Link>Project Link</Link>
        </li>
        <li>
          <Link to="/taskLink">Another Project Link</Link>
        </li>
      </ul>
    )
  }
];

export default {
  routes
};
